class Card extends React.Component{
    render(){
        return (
            <>
                <div class="card">
                    <img src="https://source.unsplash.com/user/erondu/200x200" class="card-img-top" alt="random-image" />
                    <div class="card-body">
                        <h5 class="card-title"> {this.props.card_title} </h5>
                        <p class="card-text"> {this.props.card_text} </p>
                        <a href="#"> {this.props.card_link} </a>
                    </div>
                </div>
            </>
        );
    }
}

export default Card;
